import './online.css'

export default function Online({user}) {
    return (
        <li className="friend">
        <div className="profileContainer">
            <img className="profileImg" src={user.profilePicture} alt="" />
            <span className="friendOnline"></span>
        </div>
        <span className="friendUsername">{user.username}</span>
    </li>
    )
}
